import React, { Component } from "react";

class OpenShiftInfoButton extends Component {
  constructor(props, context) {
    super(props, context);
  }
  render() {
    return (
      <div>
        <button>Open Shift</button>
      </div>
    );
  }
}


export default OpenShiftInfoButton;
